import React from 'react';
import './App.css';
import Header from "./components/header/Header";
import HeroesList from "./components/heroesList/HeroesList";
import CreateHero from "./components/createHero/CreateHero";

function App() {
  return (
    <div className="App">
      <Header/>
        <HeroesList/>
        <CreateHero/>
    </div>
  );
}

export default App;
